import React, { memo } from 'react'

import VHE from '../global/vhes/VHE'

import './css/Vhes.scss'

const Vhes = memo((props) => {

    const ConditionalWrapper = ({condition}) => {
        return condition ? (
            <div></div>
        ) : (
            null
        )
    }

    return (
        <>
            <div id={props.display_list_CLASSNAME}>
                {props.data.map((vhe, index) => (
                    <ConditionalWrapper condition={index < 9 }>
                        <VHE
                            key={index}
                            vhe={vhe}
                            card_CLASSNAME={props.card_CLASSNAME}
                            rounded_card_BOOLEAN={props.rounded_card_BOOLEAN}
                        />
                    </ConditionalWrapper>
                ))}
            </div>
        </>
    )
})

export default Vhes
